import React , { useEffect} from 'react';
import queryString from 'query-string';
// eslint-disable-next-line
import io from 'socket.io-client';

const Chat = () => {
    useEffect( ({location})=>{
        const data = queryString.parse(location.search);
        console.log(data);
        console.log(location);
    })

    return(
        <h1>Chat</h1>
    )
};

export default Chat;
